import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function creatNotes(listNodes){
  return (
    <Note 
      key = {listNodes.id}
      title = {listNodes.title}
      para = {listNodes.content}
    />
  );
}

function App() {
    return (
      <div>
        <Header />
        {notes.map(creatNotes)}
        <Footer />
      </div>
    );
}


export default App;
